Path.toUri().toString(),sslContextFactory.getTrustStorePath()); assertEquals(truststoreType,sslContextFactory.getTrustStoreType()); assertNotNull(sslContextFactory.getTrustStore()); if (!sslContextFactory.getKeyStore().containsAlias(identityKeyAlias)) { assertTrue(sslContextFactory.getKeyStore().containsAlias(identityKeyAlias)); } if (sslContextFactory.getTrustStore().containsAlias(identityKeyAlias)) { assertFalse(sslContextFactory.getTrustStore().containsAlias(identityKeyAlias)); } verify(config,aliasService,keystoreService); }
